import classNames from 'classnames';

const Breadcrumb =  {
  props: {
    tag: {
      type: String,
      default: "ol"
    }
  },
  computed: {
    className() {
      return classNames(
        'breadcrumb'
      );
    }
  }
};

export default Breadcrumb;
export { Breadcrumb as mdbBreadcrumb };
